import React from 'react';
import Button from '@mui/material/Button';
import  Field  from './Field';
import  Links  from './Links';
import  Box  from '@mui/material/Box';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';
import { Typography } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

export default  class Forms extends React.Component{
    render()
    {
      return(

        <Box
        sx={{
            marginTop: 15,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent:'center'
          }}
          onSubmit={this.Handleclick}
        >
          <Typography component="form" variant="h1">
           E-Delivery
           </Typography>
          <Typography component="form" variant="h5"
           sx={{
            margin:5
          }}>
            Log into your account
          </Typography>
          <Box
          component="form" sx={{
            '& .MuiTextField-root': { m: 1, width: '40ch' },
          }}
          noValidate
          autoComplete="off"
          >
              <Field name='username' label='Username' type='text'/>
              <Field name='passsword' label='Password' type='password'/>
              <Links text="Forgot password?" underline="none" color='blue'/>
              <ButtonUsage/>
          </Box>
        </Box>
      )
    }
  }

  class ButtonUsage extends React.Component{
    constructor(props){
      super(props)
    }
    render()
    {
      return(
        <div>
          <Button variant="contained" color='primary' fullWidth type='submit'>Login</Button>
        </div> 
      )
    }
  }



